import React from 'react'
import { FaTwitter, FaLinkedinIn, FaGithub } from "react-icons/fa";

function Social () {
  return (
    <ul>
      <li><FaTwitter /></li>
      <li><FaLinkedinIn /></li>
      <li><FaGithub /></li>
    </ul>
  )
}

export default Social
